import firebaseConfig from '../config'

function Nontification() {
    React.useEffect(()=>{
        const msg = firebaseConfig.messaging();
        msg.requestPermisson().then(()=>{
            return msg.getToken();
        }).then((data)=>{
            console.warn("token",data)
        })
    })
    return (
        <div>
            <h1>dfdf</h1>
        </div>
    )
}

export default Nontification
